import React from "react";
import { useStyles } from "../style";
import TopBarHomeItems from "./TopBarHomeItems";
function TopBarHome() {
  const classes = useStyles();
  return (
    <>
      {/* Middle */}
      <MyGridContainer className={classes.headData} item lg={8}>
        <TopBarHomeItems className={classes.headDataItems} />
      </MyGridContainer>
      {/* Login/ Sign in */}
      <MyGridContainer item lg={3} spacing={2}>
        <MyGridContainer
          justify="flex-end"
          className={classes.headAuthItems}
          item
          lg={6}
        >
          <AccountCircleIcon fontSize="large" className={classes.authIcon} />
          <MyTypography>Đăng Nhập</MyTypography>
        </MyGridContainer>

        <MyGridContainer
          justify="flex-start"
          className={classes.headAuthItems}
          item
          lg={6}
        >
          <AccountCircleIcon fontSize="large" className={classes.authIcon} />
          <MyTypography>Đăng Ký</MyTypography>
        </MyGridContainer>
      </MyGridContainer>
    </>
  );
}

export default TopBarHome;
